import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import './Navbar.scss';
import logo from './grc-logo.svg';
import $ from 'jquery';

import { Link } from 'react-router-dom';


export default class GrcNavbar extends Component {
  componentDidMount () {
    $( "li" ).hover(
      function() {
          $(this).find("span").stop().animate({
          width:"100%",
          opacity:"1",
        }, 400, function () {
        })
      }, function() {
          $(this).find("span").stop().animate({
          width:"0%",
          opacity:"0",
        }, 400, function () {
        })
      }
    );
  }
  render() {
    return (
      <div>
        <nav className="navbar navbar-inverse navbar-fixed-top" role="navigation">
        <div className="container">
          <div className="navbar-header">
            <button type="button" className="navbar-toggle" data-toggle="collapse" data-target="#bs-example-navbar-collapse-1">
              <span className="sr-only">Toggle navigation</span>
              <span className="icon-bar" />
              <span className="icon-bar" />
              <span className="icon-bar" />
            </button>
            <a className="navbar-brand" href="#">Animated Bootstrap Nav</a>
          </div>
          <div className="collapse navbar-collapse" id="bs-example-navbar-collapse-1">
            <ul className="nav navbar-nav">
              <li><a href="#">About</a><span className="hover" /></li>
              <li><a href="#">Services</a><span className="hover" /></li>
              <li><a href="#">Portfolio</a><span className="hover" /></li>
              <li><a href="#">Blog</a><span className="hover" /></li>
              <li><a href="#">Contact</a><span className="hover" /></li>
            </ul>
          </div>
        </div>
      </nav>
      </div>
    )
  }
}
